exports=async function(bid,options){const{parseCatalog,cleanNewest,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.uutxt.com/book/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/id="list"[^>]*>/,"</dl>"),recordRegex:/<dt>(?:\s*<b>[^<]+<\/b>)?(?<volume>[^<]+)<\/dt>|<dd>\s*<a href\s*="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)<\/a>\s*<\/dd>/g},{clientOptions:{...(options&&options.clientOptions)}})};